// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, Menu, MenuItem, Backdrop } from '@mui/material';
import PhoneIcon from '@mui/icons-material/Phone';

export default function Navbar() {
    const [servicesAnchorEl, setServicesAnchorEl] = React.useState(null);
    const [backdropOpen, setBackdropOpen] = React.useState(false);

    const handleServicesClick = (event) => {
        setServicesAnchorEl(event.currentTarget);
        setBackdropOpen(true);
    };

    const handleServicesClose = () => {
        setServicesAnchorEl(null);
        setBackdropOpen(false);
    };

    return (
        <div>
            <Backdrop open={backdropOpen} onClick={handleServicesClose} sx={{ zIndex: 1, color: 'darkgreen' }} />
            <AppBar position="static" sx={{ backgroundColor: 'black' }}>
                <Toolbar>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1, color: 'darkgreen', display: 'flex', alignItems: 'center' }}>
                        <img src="path/to/your/logo.png" alt="Logo" style={{ height: '30px', marginRight: '10px' }} />
                        IT Consulting
                    </Typography>
                    <div>
                        <Button color="inherit" onClick={handleServicesClick} sx={{ color: 'darkgreen', fontWeight: 'bold' }}>
                            Services
                        </Button>
                        <Menu
                            anchorEl={servicesAnchorEl}
                            open={Boolean(servicesAnchorEl)}
                            onClose={handleServicesClose}
                            anchorOrigin={{ vertical: 'bottom', horizontal: 'left' }}
                            transformOrigin={{ vertical: 'top', horizontal: 'left' }}
                            getContentAnchorEl={null}
                            elevation={0}
                            sx={{ backgroundColor: 'black', color: 'darkgreen' }}
                        >
                            <MenuItem component={Link} to="/services/cloud-transformation" onClick={handleServicesClose}>Cloud Transformation</MenuItem>
                            <MenuItem component={Link} to="/services/data-science-ai" onClick={handleServicesClose}>Data Science & AI</MenuItem>
                            <MenuItem component={Link} to="/services/data-engineering" onClick={handleServicesClose}>Data Engineering</MenuItem>
                            <MenuItem component={Link} to="/services/full-stack-development" onClick={handleServicesClose}>Full-Stack Development</MenuItem>
                        </Menu>
                    </div>
                    <Button color="inherit" component={Link} to="/about">
                        About
                    </Button>
                    <Button color="inherit" component={Link} to="/insight">
                        Insight
                    </Button>
                    <Button color="inherit" component={Link} to="/careers">
                        Careers
                    </Button>
                    <Button color="inherit" sx={{ color: 'darkgreen' }}>
                        <PhoneIcon />
                    </Button>
                </Toolbar>
            </AppBar>
        </div>
    );
}
